import './App.css';
import Header from './Components/Header';
import About from './Components/About';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Routes
} from "react-router-dom";

function App() {

  return (
    <>
    <Router>
    <div className="App">
        <Switch>
          <Route path="/about">
            <About />
          </Route>

          <Route path="/">
          <Header/>
          </Route>
          </Switch>
    </div>
    </Router>
    </>
  );
}

export default App;
